import React, { Component } from "react";
import { DeleteButton } from "./styles";
import { Div } from "./../../../../styles"


class Todoitem extends Component {

    handleSubmit = (event) => {
      event.preventDefault();
      this.props.deleteTodo(this.props.id);
    }

    render() {
      return (
          <li>
              <Div flexDirection="row" justifyContent="space-between" alignItems="center" flexWrap="nowrap" style={{marginRight: 20+'%'}}>
                <p> {this.props.payload} </p>
                <DeleteButton style={{flexShrink: 0, height: 30 + 'px'}} onClick={this.handleSubmit}>Delete</DeleteButton>
              </Div>
          </li>
      );
    }
  }

export default Todoitem;
